import React, { Component } from 'react';

const text = {
  name: 'Carula Garat',
  title: 'UX/UI Designer',
};

const myDiv = <button onClick={changeName}>something something</button>;

function changeName() {
  text.name = 'Someone';
}

let img;

if(text.name === 'Carula Garat') {
  img = (
    <div>
      carula
    </div>
  );
} else {
  img = (
    <div>
      other
    </div>
  );
}

class App extends Component {
  render() {
    return (
      <div className="mainlayout">
        <h1>{text.name}</h1>
        <h2>{text.title}</h2>
        {myDiv}
        {img}
      </div>
    );
  }
}

export default App;
